column13:
A crown (10) comprising: 
a steerer tube boss (406); 
a first upper tube boss (404); 
a second upper tube boss (404), wherein the first upper tube boss and the second upper tube boss reside on a plane (720) on opposing sides of the steerer tube boss (406), wherein the plane (720) comprises the central axis of the first upper tube boss and the central axis of the second upper tube boss; 
a first arm (402) to connect the first upper tube boss (404) to the steerer tube boss (406); and 
a second arm (402) to connect the second upper tube boss (404) to the steerer tube boss (406), at least one of the first arm and/or the second arm comprises at least one bore (516) that extends in a direction that is substantially normal to the plane (720).
